import React from 'react';


class User extends React.Component {
    render() {
        const users = this.props.users;
        console.log(users);
        return (
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>name</th>
                        <th>place</th>
                    </tr>
                </thead>
                <tbody>
                    { users.map( (user) => {
                        <tr>
                            <td></td>
                        </tr>
                    } ) }
                </tbody>
            </table>
        )
    }
}

export default User;
